import React from "react";
import "./MoreButton.scss";

type Props = {
  hasNext: boolean;
  handleMoreResults: () => Promise<void>;
};

function MoreButton({ hasNext, handleMoreResults }: Props) {
  if (hasNext) {
    return (
      <div className={"more-results-banner"}>
        <a href="#" onClick={handleMoreResults}>
          {" "}
          More results{" "}
        </a>
        <button onClick={handleMoreResults}>More results</button>
      </div>
    );
  } else {
    return null;
  }
}

export default MoreButton;
